    $.fn.swslide = function ($direction) {
        var $slider = this;
        var $items = $slider.find(".items");
        if (!$slider.attr("data-position")) {
            $slider.attr("data-position", 0);
        }
        var $position = parseFloat($slider.attr("data-position"));
        var $width = parseFloat($items.find("li:first-child").css("width"));
        var $percent = ($width / parseFloat($items.css("width"))) * 100;
        if ($percent < 17) {
            $percent = 16.666666;
            $columns = 6;
        } else if ($percent < 22) {
            $percent = 20;
            $columns = 5;
        } else if ($percent < 28) {
            $percent = 25;
            $columns = 4;
        } else if ($percent < 36) {
            $percent = 33.333333;
            $columns = 3;
        } else if ($percent < 54) {
            $percent = 50;
            $columns = 2;
        } else {
            $percent = 100;
            $columns = 1;
        }
        var $count = $items.find("li").length;
        var $offset = $count - $columns;
        if ($direction == "right") {
            if ($columns > 2) {
                $position -= parseFloat($width * ($columns - 1));
            } else {
                $position -= parseFloat($width * $columns);
            }
            if (parseInt(Math.abs($position)) > parseInt($offset * $width)) {
                $position = $width * ($count - $columns) * -1;
            }
        } else if ($direction == "left") {
            if ($columns > 2) {
                $position += parseFloat($width * ($columns - 1));
            } else {
                $position += parseFloat($width * $columns);
            }
            if (parseInt($position) > 0) {
                $position = 0;
            }
        }
        $slider.attr("data-position", $position);
        $items.css("transform", "translateX(" + $position + "px)");
        if (parseInt($position) > -10) {
            $slider.find(".slider-nav-left").addClass("hide");
        } else {
            $slider.find(".slider-nav-left").removeClass("hide");
        }
        if (parseInt(Math.abs($position)) >= parseInt($offset * $width) || $count <= $columns) {
            $slider.find(".slider-nav-right").addClass("hide");
        } else {
            $slider.find(".slider-nav-right").removeClass("hide");
        }
        setTimeout(function () {
            $(window).scroll();
        }, 500);
    };
