    $countdown = function () {
        if ($(".countdown").length > 0) {
            $i = 0;
            $now = moment.utc();
            $(".countdown").each(function () {
                $then = moment.unix($(this).attr("data-timestamp"));
                $seconds = moment($then).diff($now);
                if ($seconds <= 0) {
                    $(this)
                        .html($(this).attr("data-expired") ? $(this).attr("data-expired") + " " : "")
                        .removeClass("countdown");
                    if ($(this).attr("data-callback")) {
                        eval($(this).attr("data-callback"));
                    }
                } else {
                    if ($seconds < 86400000) {
                        $(this).html(($(this).attr("data-prefix") ? $(this).attr("data-prefix") + " " : "") + moment.utc($seconds).format("HH:mm:ss"));
                    } else {
                        $(this).html(($(this).attr("data-prefix") ? $(this).attr("data-prefix") + " " : "") + moment.utc($then).fromNow(!0));
                    }
                    $i++;
                }
            });
            setTimeout($countdown, 1000);
        }
    };
