    function switch_country(data) {
        $("*[data-base-price]").each(function () {
            if (typeof data.currency.rate !== "undefined") {
                if (data.currency.rate) {
                    $(this).text(data.currency.prefix + format_price(Math.round((parseInt($(this).attr("data-base-price")) * data.currency.rate) / 10) * 10));
                }
            }
        });
        $("*[data-base-size]").each(function () {
            if (typeof data.size.rate !== "undefined") {
                if (data.size.rate) {
                    $(this).text(parseInt($(this).attr("data-base-size")) + data.size.rate);
                }
            }
        });
        $("*[data-base-country-name]").each(function () {
            if (typeof data.country.name !== "undefined") {
                if (data.country.name) {
                    $(this).text(data.country.name);
                }
            }
        });
        $("*[data-base-country-plural]").each(function () {
            if (typeof data.country.plural !== "undefined") {
                if (data.country.plural) {
                    $(this).text(data.country.plural);
                }
            }
        });
        if (typeof switch_country_local === "function") {
            switch_country_local(data);
        }
    }
