function toastAjax() {
    var $vTimer = 4000;
    var $pMin = 8;
    var $pMax = 30;
    $.ajax({
        url: $base + "/api/toast",
        dataType: "json",
        cache: !0,
        success: function (data) {
            if (typeof data.messages != "undefined") {
                $.each(data.messages, function (key, value) {
                    setTimeout(function () {
                        toast(value.message, value.image);
                    }, $vTimer);
                    $vTimer += Math.round(Math.random() * ($pMax * 1000 - $pMin * 1000)) + $pMin * 1000;
                });
            }
        },
    });
}
